import React from 'react';
import icone from '../../styles/images/icone.png';
import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.min.css';
import '../../styles/css/layout.css';
import { BiLogOutCircle } from 'react-icons/bi/index'

const style = {
    main: {
        height: '100%',
        width: '100%',
        background: '#fff',
        display: 'flex',
        flexDirection: 'column'
    },
    navbar: {
        height: '7%',
        width: '100%',
        display: 'flex',
        background: '#ff773bbd',
        alignItems: 'center',
        justifyContent: 'space-between'
    }
}

const Layout = (props) => {
    return (
        <main style={style.main}>
            <div style={style.navbar}>
                <div style={{marginLeft: '10px' }}>
                    <img style={{ width: '46px'}} src={icone} alt="CNX Telecom - vocÃª sempre conectado!" />
                </div>
                <div style={{ marginRight: '10px' }}>
                    <BiLogOutCircle />
                </div>
            </div>
            <div>

            </div>
        </main>
    )
}

export default Layout;
